    data: |
      SELECT - col1 * - col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + + col0 * + - ( - 74 ) IS NULL AND - 10 NOT BETWEEN - - col0 AND + 13 - - 96;
  - name: tab2

outputs:
  - name: q4672.out
    data: |
      1173
      3080
      3886
